import React from "react";
import europe from '../Pictures/Europe.jpg'

function Europe(){
    return(
        <div class="Europe">
            <svg viewBox="0 0 1920 1080"></svg>
            <img src={europe} alt="Европа"/>
        </div>
    )
}

export default Europe;
